import React from "react";

const Resume = () => {
  return (
    <div className="mt-32 h-full bg">
      <div></div>
      <h1>RESUME</h1>
      <div>
        <p>Experience</p>
        <button>DOWNLOAD CV</button>
      </div>
    </div>
  );
};

export default Resume;
